import React,{useState, useEffect} from 'react'
import axios from 'axios'

const CafeReviews = () => {
  const [cafe,setCafe] = useState([])

  useEffect(() => {
    axios.get('/api/cafes/:id')
    .then(result => {
        setCafe(result.data)
    })
  },[])

  return
}

export default CafeReviews
